    'Air or vacuum pumps, air or other gas compressors and fans; ventilating or recycling hoods incorporating a fan, whether or not fitted with filters; gas-tight biological safety cabinets, whether or not fitted with filters' => 'Bombas de ar ou de vácuo, compressores de ar ou de outros gases e ventiladores; exaustores (coifas aspirantes) para extração ou reciclagem, com ventilador incorporado, mesmo filtrantes; câmaras (cabinas) de segurança biológica estanques aos gases, mesmo filtrantes',
    'Air-conditioning machines, comprising a motor-driven fan and elements for changing the temperature and humidity, including those machines in which the humidity cannot be separately regulated' => 'Máquinas e aparelhos de ar condicionado que contenham um ventilador motorizado e dispositivos próprios para modificar a temperatura e a humidade, incluindo as máquinas e aparelhos em que a humidade não seja regulável separadamente',
    'Furnace burners for liquid fuel, for pulverised solid fuel or for gas; mechanical stokers, including their mechanical grates, mechanical ash dischargers and similar appliances' => 'Queimadores para alimentação de fornalhas de combustíveis líquidos, combustíveis sólidos pulverizados ou de gás; fornalhas automáticas, incluindo as antefornalhas, grelhas mecânicas, descarregadores mecânicos de cinzas e dispositivos semelhantes',
    'Industrial or laboratory furnaces and ovens, including incinerators, non-electric' => 'Fornos industriais ou de laboratório, incluindo os incineradores, não elétricos',
    'Refrigerators, freezers and other refrigerating or freezing equipment, electric or other; heat pumps other than air-conditioning machines of heading 8415' => 'Refrigeradores, congeladores (freezers) e outros materiais, máquinas e aparelhos, para a produção de frio, com equipamento elétrico ou outro; bombas de calor, exceto as máquinas e aparelhos de ar condicionado da posição 8415',
    'Machinery, plant or laboratory equipment, whether or not electrically heated (excluding furnaces, ovens and other equipment of heading 8514), for the treatment of materials by a process involving a change of temperature such as heating, cooking, roasting, distilling, rectifying, sterilising, pasteurising, steaming, drying, evaporating, vaporising, condensing or cooling, other than machinery or plant of a kind used for domestic purposes; instantaneous or storage water heaters, non-electric' => 'Aparelhos, dispositivos ou equipamentos de laboratório, mesmo aquecidos eletricamente (exceto os fornos e outros aparelhos da posição 8514), para tratamento de matérias por meio de operações que impliquem mudança de temperatura, tais como aquecimento, cozimento, torrefação, destilação, retificação, esterilização, pasteurização, estufagem, secagem, evaporação, vaporização, condensação ou arrefecimento, exceto os de uso doméstico; aquecedores de água não elétricos, de aquecimento instantâneo ou de acumulação',
    'Calendering or other rolling machines, other than for metals or glass, and cylinders therefor' => 'Calandras e laminadores, exceto os destinados ao tratamento de metais ou vidro, e seus cilindros',
    'Centrifuges, including centrifugal dryers; filtering or purifying machinery and apparatus, for liquids or gases' => 'Centrifugadores, incluindo os secadores centrífugos; aparelhos para filtrar ou depurar líquidos ou gases',
    'Dishwashing machines; machinery for cleaning or drying bottles or other containers; machinery for filling, closing, sealing or labelling bottles, cans, boxes, bags or other containers; machinery for capsuling bottles, jars, tubes and similar containers; other packing or wrapping machinery (including heat-shrink wrapping machinery); machinery for aerating beverages' => 'Máquinas de lavar louça; máquinas e aparelhos para limpar ou secar garrafas ou outros recipientes; máquinas e aparelhos para encher, fechar, arrolhar ou rotular garrafas, caixas, latas, sacos ou outros recipientes; máquinas e aparelhos para capsular garrafas, vasos, tubos e recipientes semelhantes; outras máquinas e aparelhos para empacotar ou embalar mercadorias (incluindo as máquinas e aparelhos para embalar com película termorretráctil); máquinas e aparelhos para gaseificar bebidas',
    'Weighing machinery (excluding balances of a sensitivity of 5 cg or better), including weight-operated counting or checking machines; weighing machine weights of all kinds' => 'Aparelhos e instrumentos de pesagem, incluindo as básculas e balanças para verificar peças fabricadas (usinadas), excluindo as balanças sensíveis a pesos não superiores a 5 cg; pesos para quaisquer balanças',
    'Mechanical appliances (whether or not hand-operated) for projecting, dispersing or spraying liquids or powders; fire extinguishers, whether or not charged; spray guns and similar appliances; steam or sandblasting machines and similar jet projecting machines' => 'Aparelhos mecânicos (mesmo manuais) para projetar, dispersar ou pulverizar líquidos ou pós; extintores, mesmo carregados; pistolas aerográficas e aparelhos semelhantes; máquinas e aparelhos de jato de areia, de jato de vapor e aparelhos de jato semelhantes',
    'Pulley tackle and hoists other than skip hoists; winches and capstans; jacks' => 'Talhas, cadernais e moitões; guinchos e cabrestantes; macacos',
    'Ships\' derricks; cranes, including cable cranes; mobile lifting frames, straddle carriers and works trucks fitted with a crane' => 'Cábreas; guindastes, incluindo os de cabo; pontes rolantes, pórticos de descarga ou de movimentação, pontes-guindastes, carros-pórticos e carros-guindastes',
    'Fork-lift trucks; other works trucks fitted with lifting or handling equipment' => 'Empilhadoras; outros veículos para movimentação de carga e semelhantes, equipados com dispositivos de elevação',
    'Other lifting, handling, loading or unloading machinery (for example, lifts, escalators, conveyors, teleferics)' => 'Outras máquinas e aparelhos de elevação, de carga, de descarga ou de movimentação (por exemplo, elevadores, escadas rolantes, transportadores, teleféricos)',
    'Self-propelled bulldozers, angledozers, graders, levellers, scrapers, mechanical shovels, excavators, shovel loaders, tamping machines and roadrollers' => 'Bulldozers, angledozers, niveladores, raspo-transportadores (scrapers), pás mecânicas, escavadores, carregadores e pás carregadoras, compactadores e rolos ou cilindros compressores, autopropulsionados',
    'Other moving, grading, levelling, scraping, excavating, tamping, compacting, extracting or boring machinery, for earth, minerals or ores; piledrivers and pile extractors; snowploughs and snowblowers' => 'Outras máquinas e aparelhos de terraplenagem, nivelamento, raspagem, escavação, compactação, extração ou perfuração da terra, de minerais ou minérios; bate-estacas e arranca-estacas; limpa-neves',
    'Parts suitable for use solely or principally with the machinery of headings 8425 to 8430' => 'Partes reconhecíveis como exclusiva ou principalmente destinadas às máquinas e aparelhos das posições 8425 a 8430',
    'Agricultural, horticultural or forestry machinery for soil preparation or cultivation; lawn or sports-ground rollers' => 'Máquinas e aparelhos de uso agrícola, hortícola ou florestal, para preparação ou trabalho do solo ou para cultura; rolos para relvados (gramados) ou para campos de desporto',
    'Harvesting or threshing machinery, including straw or fodder balers; grass or hay mowers; machines for cleaning, sorting or grading eggs, fruit or other agricultural produce, other than machinery of heading 8437' => 'Máquinas e aparelhos para colheita ou debulha de produtos agrícolas, incluindo as enfardadeiras de palha ou forragem; cortadores de relva (grama) e ceifeiras; máquinas para limpar ou selecionar ovos, fruta ou outros produtos agrícolas, exceto as da posição 8437',
    'Milking machines and dairy machinery' => 'Máquinas de ordenhar e máquinas e aparelhos para a indústria de laticínios',
    'Presses, crushers and similar machinery used in the manufacture of wine, cider, fruit juices or similar beverages' => 'Prensas, esmagadores e máquinas e aparelhos semelhantes, para fabricação de vinho, sidra, sumos (sucos) de fruta ou bebidas semelhantes',
    'Other agricultural, horticultural, forestry, poultry-keeping or bee-keeping machinery, including germination plant fitted with mechanical or thermal equipment; poultry incubators and brooders' => 'Outras máquinas e aparelhos para agricultura, horticultura, silvicultura, avicultura ou apicultura, incluindo os germinadores equipados com dispositivos mecânicos ou térmicos e as chocadeiras e criadeiras para avicultura',
    'Machines for cleaning, sorting or grading seed, grain or dried leguminous vegetables; machinery used in the milling industry or for the working of cereals or dried leguminous vegetables, other than farm-type machinery' => 'Máquinas para limpeza, seleção ou peneiração de grãos ou de produtos hortícolas secos; máquinas e aparelhos para a indústria de moagem ou tratamento de cereais ou de produtos hortícolas secos, exceto do tipo utilizado em fazendas',
    'Machinery, not specified or included elsewhere in this chapter, for the industrial preparation or manufacture of food or drink, other than machinery for the extraction or preparation of animal or fixed vegetable or microbial fats or oils' => 'Máquinas e aparelhos não especificados nem compreendidos noutras posições do presente Capítulo, para preparação ou fabricação industrial de alimentos ou de bebidas, exceto as máquinas e aparelhos para extração ou preparação de óleos ou gorduras vegetais ou de origem microbiana, fixos, ou de animais',
    'Machinery for making pulp of fibrous cellulosic material or for making or finishing paper or paperboard' => 'Máquinas e aparelhos para fabricação de pasta de matérias fibrosas celulósicas ou para fabricação ou acabamento de papel ou cartão',
    'Bookbinding machinery, including book-sewing machines' => 'Máquinas e aparelhos para brochura ou encadernação, incluindo as máquinas de costurar cadernos',
    'Other machinery for making up paper pulp, paper or paperboard, including cutting machines of all kinds' => 'Outras máquinas e aparelhos para o trabalho de pasta de papel, papel ou cartão, incluindo as cortadeiras de qualquer tipo',
    'Machinery, apparatus and equipment (other than the machines of headings 8456 to 8465) for preparing or making plates, cylinders or other printing components; plates, cylinders and other printing components; plates, cylinders and lithographic stones, prepared for printing purposes (for example, planed, grained or polished)' => 'Máquinas, aparelhos e equipamentos (exceto as máquinas das posições 8456 a 8465), para preparação ou fabricação de clichés, placas, cilindros ou outros elementos de impressão; clichés, placas, cilindros e outros elementos de impressão; pedras litográficas, placas e cilindros, preparados para impressão (por exemplo, aplainados, granulados ou polidos)',
    'Printing machinery used for printing by means of plates, cylinders and other printing components of heading 8442; other printers, copying machines and facsimile machines, whether or not combined; parts and accessories thereof' => 'Máquinas e aparelhos de impressão por meio de placas, cilindros e outros elementos de impressão da posição 8442; outras impressoras, aparelhos de copiar e aparelhos de telecopiar (fax), mesmo combinados entre si; partes e acessórios',
    'Machines for extruding, drawing, texturing or cutting man-made textile materials' => 'Máquinas para extrudar, estirar, texturizar ou cortar matérias têxteis sintéticas ou artificiais',
