    'Sewing machines, other than book-sewing machines of heading 8440; furniture, bases and covers specially designed for sewing machines; sewing machine needles' => 'Máquinas de costura, exceto as de costurar cadernos da posição 8440; móveis, bases e tampas, próprios para máquinas de costura; agulhas para máquinas de costura',
    'Machinery for preparing, tanning or working hides, skins or leather or for making or repairing footwear or other articles of hides, skins or leather, other than sewing machines' => 'Máquinas e aparelhos para preparar, curtir ou trabalhar couros ou peles, ou para fabricar ou consertar calçado e outras obras de couro ou de pele, exceto máquinas de costura',
    'Converters, ladles, ingot moulds and casting machines, of a kind used in metallurgy or in metal foundries' => 'Conversores, cadinhos ou colheres de fundição, lingoteiras e máquinas de vazar (moldar), para metalurgia, aciaria ou fundição',
    'Metal-rolling mills and rolls therefor' => 'Laminadores de metais e seus cilindros',
    'Machine tools for working any material by removal of material, by laser or other light or photon beam, ultrasonic, electrodischarge, electrochemical, electron beam, ionic-beam or plasma arc processes; water-jet cutting machines' => 'Máquinas-ferramentas que trabalhem por eliminação de qualquer matéria, que operem por laser ou por outro feixe de luz ou de fotões, por ultrassom, por eletroerosão, por processos eletroquímicos, por feixes de eletrões, por feixes iónicos ou por jato de plasma; máquinas de corte a jato de água',
    'Machining centres, unit construction machines (single station) and multi-station transfer machines, for working metal' => 'Centros de fabricação (usinagem), máquinas de sistema monostático (single station) e máquinas de estações múltiplas, para trabalhar metais',
    'Lathes (including turning centres) for removing metal' => 'Tornos (incluindo os centros de torneamento) para metais',
